import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

class Calculate {
  constructor(a,b){
    this.add = a;
    this.sub = b;
  }

  operations(){
    const plus = this.add + this.sub;
    const minus = this.add - this.sub;
    const multi = this.add * this.sub;
    const div = this.add / this.sub;
    return [plus,minus,multi,div];
  }

  shows(){
    return this.operations();
  }
}

const calc = new Calculate(5,6);
const show = calc.shows();


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    calc.shows();
  </React.StrictMode>
);

